    add_empty_message(){


        this.container_d3.selectAll(".empty_message").remove()

        if (phylo.phylo_embedded){

            if (phylo.bound_container[0]==this.container_object){
                tooltip_object[0].show()
                tooltip_object[3].show()
                }

        }



        this.viewer.svg_d3.node().append('g')
            .attr("class", 'empty_message')
            .attr('width',this.viewer.width )
            .attr("transform", "translate("+ (this.viewer.width/2)+"," + (this.viewer.height/2)  + ")")
            .append("text")
            .attr("fill", "#333")
            .attr('text-anchor', 'middle')
            .style('font-size', '1.2em')
            .html('No tree here ! You can <a href="#" id="add_tree_link' + this.container_object.uid +'">add a tree</a> or use examples below.')

        document.querySelector('#add_tree_link'+ this.container_object.uid).addEventListener('click', event => {
            $('#exampleModal' + this.container_object.uid).modal('show')
        });



        this.viewer.svg_d3.node().append('text')
            .attr("class", 'empty_message')
            .attr("transform", "translate("+ (this.viewer.width/2)+"," + (this.viewer.height/2 + 24)  + ")")
            .attr('text-anchor', 'middle')
            .attr("fill", "#bbb")
            .html("Ready to use examples: <a id='ex1"+ this.container_object.uid +"' style='cursor:pointer;text-decoration: underline'>Tree bundle #1</a> - <a style='cursor:pointer;text-decoration: underline' id='ex2"+ this.container_object.uid +"'>Tree bundle #2</a> ")



            document.querySelector('#ex1'+ this.container_object.uid).addEventListener('click', event => {
                this.container_object.add_tree(this.examples["unrooted1"])
                this.container_object.add_tree(this.examples["small1"])

                phylo.start()
            });

        document.querySelector('#ex2'+ this.container_object.uid).addEventListener('click', event => {


            this.container_object.add_tree(this.examples["nhx2"],{'data_type': 'nhx'})
            this.container_object.add_tree(this.examples["unrooted2"])
            this.container_object.add_tree(this.examples["small2"])
            this.container_object.add_tree(this.examples["stack"],{'data_type': 'json', 'use_branch_lenght': false, 'show_histogram':true, 'collapse_level': 2})
            phylo.start()
        });

    }


